webpackJsonp([0x5f7d49d1226e],{477:function(a,p){a.exports={data:{markdownRemark:{html:'<h1>pip</h1>\n<p>pip - устанавливает пакеты для python2</p>\n<p>Если нужно для третьего, то понадобится pip3</p>\n<div class="gatsby-highlight" data-language="text"><pre class="language-text"><code class="language-text">apt-get install python3-pip</code></pre></div>\n<h2>Установка конкретной версии пакета</h2>\n<div class="gatsby-highlight" data-language="text"><pre class="language-text"><code class="language-text">pip install PyQt5==5.5</code></pre></div>\n<p>Если нужно указывать диапазон версий, то нужно заключить пакет в кавычки:</p>\n<div class="gatsby-highlight" data-language="text"><pre class="language-text"><code class="language-text">pip install &quot;package&gt;=0.2,&lt;0.3&quot;</code></pre></div>\n<h2>Установка pip без интернета:</h2>\n<div class="gatsby-highlight" data-language="shell"><pre class="language-shell"><code class="language-shell">python pip-6.0.6-py2.py3-none-any.whl/pip <span class="token function">install</span> --no-index pip-6.0.6-py2.py3-none-any.whl</code></pre></div>\n<p>.whl можно взять здесь: <a href="https://pypi.python.org/simple/pip/">https://pypi.python.org/simple/pip/</a></p>',frontmatter:{path:"/blog/pip",title:"pip"}}},pathContext:{}}}});
